INSERT INTO `faqs` VALUES (1,'How do I place an order?','To place an order, navigate to the product page, select the desired options, and click the \"Add to Cart\" button.',2,'published','2023-12-24 07:20:38','2023-12-24 07:20:38'),(2,'What are the shipping options?','We offer standard and expedited shipping options. Shipping costs and delivery times vary based on your location and chosen shipping method.',2,'published','2023-12-24 07:20:38','2023-12-24 07:20:38'),(3,'How can I return a product?','If you are not satisfied with your purchase, you can initiate a return within 30 days of receiving the product. Contact our customer service for further instructions.',1,'published','2023-12-24 07:20:38','2023-12-24 07:20:38'),(4,'What payment methods do you accept?','We accept major credit cards, PayPal, and other secure payment methods.',1,'published','2023-12-24 07:20:38','2023-12-24 07:20:38'),(5,'How can I update my account information?','Log in to your account and go to the \"Account Settings\" page to update your information, including your password and shipping address.',1,'published','2023-12-24 07:20:38','2023-12-24 07:20:38'),(6,'Are there any ongoing promotions or discounts?','Check our \"Promotions\" page for information on current discounts, special offers, and ongoing promotions.',1,'published','2023-12-24 07:20:38','2023-12-24 07:20:38'),(7,'Is the product in stock?','Product availability is indicated on each product page. If a product is out of stock, you may choose to be notified when it becomes available.',3,'published','2023-12-24 07:20:38','2023-12-24 07:20:38'),(8,'How is my personal information secured?','We take the security and privacy of your information seriously. Our website uses encryption technology to protect your personal data.',3,'published','2023-12-24 07:20:38','2023-12-24 07:20:38'),(9,'How do I get technical support?','For technical issues or assistance, contact our customer support team through the \"Contact Us\" page, and we will help you resolve any problems.',1,'published','2023-12-24 07:20:38','2023-12-24 07:20:38'),(10,'Do you offer international shipping?','Yes, we offer international shipping to many countries. Shipping costs and delivery times vary based on the destination.',3,'published','2023-12-24 07:20:38','2023-12-24 07:20:38'),(11,'Can I purchase a gift card?','Yes, we offer gift cards of varying denominations. Gift cards can be purchased on our website and make for a great gift for friends and family.',1,'published','2023-12-24 07:20:38','2023-12-24 07:20:38'),(12,'What is the warranty on your products?','Our products come with a standard warranty. Check the product documentation or contact our customer service for details on specific product warranties.',3,'published','2023-12-24 07:20:38','2023-12-24 07:20:38');
/*!40000 ALTER TABLE `faqs` ENABLE KEYS */;
UNLOCK TABLES;

